create table employee (
	id INT,
	full_name VARCHAR(50),
	email VARCHAR(50),
	gender VARCHAR(50),
	department VARCHAR(50),
	city VARCHAR(50),
	salary VARCHAR(50)
);



-- WAQ to featch Top all records
select  *  from employee;

-- WAQ to featch Top 10 records
select top 10 * from employee;

-- WAQ to featch Full name of employee
select full_name from employee;

-- WAQ to Featch Unique Values of Department in Employee table
select distinct department from employee

-- WAQ to Find duplicate record in a table
select city,count(*) from employee group by city having count(*)>1;

-- WAQ to Get second high salary 
select max(salary) as second_high_salary from employee where salary < (select max(salary) from employee)

-- WAQ to Get Second high salary department wise
select max(salary) as sec_high_sal, department from employee
where salary < (select max(salary) from employee)
group by department

-- WAQ to Rank employess by salary within each department
select full_name,department,max(salary),rank() over (partition by department order by salary desc) as salary_rk
from employee where salary < (select max(salary) from employee)
 group by department,full_name,salary;